// @include	http*://www.google.*/
// @include	http*://www.google.*/?gws_rd=*
// @include	http*://www.google.*/#*
// @include	https://encrypted.google.*/webhp?*
// @include	https://encrypted.google.*/search?*
// @include	https://encrypted.google.*/ig?*
// @include	https://encrypted.google.*/
// @include	https://encrypted.google.*/#*
// @include	http*://ipv6.google.*/
// ==/UserScript==

var loadingInstant = false;
var instantInterval = null;

function TwentyPercentCooler() {
	var GoogleLogo = document.getElementById("lga");
	var searchLogo = document.getElementById("gbqlw");
	if (loadingInstant) {
		if (document.getElementById("sfcnt") == null) {
			return;

		}
		clearInterval(instantInterval);
		loadingInstant = false;
	}

	if (GoogleLogo != null) {
		GoogleLogo.innerHTML = '<img id="hplogo" src="data:image/png;base64," style="width:551px;height:234px;margin-top:-7px;margin-left:1px" alt="" />';
	}

	if (searchLogo != null) {
		searchLogo.innerHTML = '<img id="gbqld" src="data:image/png;base64," width="95" alt="">';
	}
}

window.addEventListener("hashchange", TwentyPercentCooler, false);
if (window.location.hash != "") {
	loadingInstant = true;
	instantInterval = setInterval(TwentyPercentCooler, 100);
}

TwentyPercentCooler();
